import {useState} from 'react';


const StatsDisplay = ({stats}) => {
    console.log(stats);
    /*const [currency,setCurrency] = useState('USD');*/

    return (
        <div>
          <ul>
              <li>
                  {stats.sacramento[0]}
              </li>
          </ul>
        </div>
    );
};
export default StatsDisplay;
